import './App.css';

function App() {
  return (
    <div className="App">
      <div className="Folder" id="folder1">
        <div className="Tab"></div>
      </div>
      <div className="Folder" id="folder2">
        <div className="Tab"></div>
      </div>
      <div className="Folder" id="folder3"></div>
    </div>
  );
}

export default App;
